import Login from "./components/Login";


ReactDOM.render(
  <React.StrictMode>
  <BrowserRouter>
    <Routes>
        <Route exact path='/' element={ <Login/>}/>
        { localStorage.getItem("user-info") ? <Route exact path='/shop' element={ <App/>}/> : <span> Login to go to shop.</span> } 
    </Routes>
  </BrowserRouter>

  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
